		function nextQuestion() { //פונקציה המגרילה שאלות
			var currQuestions = []; // הגדרת מערך ריק, אליו נכניס את מערך השאלות המעודכן בכל סבב על מנת להגריל שאלה מתאימה
			//כך לא נפגע במערך השאלות תשובות המקורי
			for (var i = 0; i < qas[mychoice - 1].questions.length; i++) { //לולאה שרצה על כמות השאלות הקיימות לנושא הנבחר
				var currQuestion = qas[mychoice - 1].questions[i]; // משתנה השומר את השאלה הנוכחי שרצה בלולאה
				if (currQuestion.result == "none" || // במידה והשאלה שמורה כלא נענתה
					(currQuestion.result == "fail" && // או במידה והשאלה שמורה שנענתה לא נכון וגם היא שונה מהשאלה האחרונה שהוגרלה
						lastQuestion != currQuestion)) { // הכנס את השאלה למערך שהגדרנו בפונקציה הנוכחית
					currQuestions.push(currQuestion); // כך למעשה כל השאלות הרלוונטיות לשחקן נכנסות למערך חדש  ממנו נגריל שאלה בכל סבב
				}
			}
			if (currQuestions.length == 0) { // במידה ואורך המערך שווה לאפס, זה לא אומר שלא נותרו שאלות. אלא מקרה קצה בו נותרה שאלה אחת עלייה הוא עונה באופן שגוי בכל פעם
				for (var i = 0; i < qas[mychoice - 1].questions.length; i++) { // לולאה אשר רצה על כל השאלות
					var currQuestion = qas[mychoice - 1].questions[i]; // שמירת השאלה הנוכחית במשתנה
					if (currQuestion.result == "fail") { // במידה והשאלה אכן שמורה כנענתה לא נכון
						lastQuestion = currQuestion; // להציג אותה שוב
						lastQuestion.trials++; // להעלות את כמות הניסיונות של השאלה למענה	
						return true; // להחזיר כי הפונקציה עדיין מגרילה שאלות
					}
				}
				return false; // אחרת להחזיר כי היא לא מגרילה כי לא נותרו שאלות ולעבור למסך מסכם
			}
		
			lastQuestion = currQuestions[Math.floor(Math.random() * (currQuestions.length))]; // בהתאם למערך שנוצר, ביצוע רנדום לשאלה והצבתה במשתנה הגלובלי
			lastQuestion.trials++; // העלאת כמות הניסיונות לשאלה
			return true;
			/*soundFunc();*/
		}
		
		
